import React, { useRef, useState, useEffect } from "react";
import { Redirect } from 'react-router';
import { Header } from "../../common/Header";
import {
    MDBBtn,
    MDBFreeBird,
    MDBCard,
    MDBCardBody,
    MDBCardImage,
    MDBCardText,
    MDBCol,
    MDBContainer,
    MDBFormInline,
    MDBIcon,
    MDBInput,
    MDBRow,
    MDBTable,
    MDBTableBody,
    MDBTableHead,
    MDBEdgeHeader,
    MDBCardTitle,
    MDBProgress
} from "mdbreact";
import { useHistory } from "react-router";
import "./style.css"

export const Home = (props: any) => {
    console.log(props)
    if (props.User === undefined) {
        return <Redirect to={{
            pathname: '/login',
        }} />
    }

    return (
        <>
            <MDBContainer fluid>
                <MDBRow>
                <p className='text-light font-weight-bold' style={{ fontSize: "20px", paddingTop:"20px" }}>Organisation health</p>
                <MDBBtn style={{ border: "2px solid #2bbbad", borderRadius: "10px" }}>Scan
                <MDBIcon icon="sync-alt" style={{ fontSize: "10px", marginLeft: "3px" }} /></MDBBtn> 
                <span className='text-light' style={{ fontSize: "12px", marginLeft: "10px" }}>www.sampleapplication.com</span>
                </MDBRow>

            </MDBContainer>
        </>
    )
}
